import React, { Component } from "react";
import { BrowserRouter, Router, Route } from "react-router-dom";
import Landing from "./components/layout/Landing";

class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <div className="App">
          <Route exact path="/" component={Landing} />
        </div>
      </BrowserRouter>
    );
  }
}
export default App;
